import "./styles/formCard.css";

const FormCard = () => {
  return (
    <div className="container-form-card">
      <form action="">
        <input
          className="input-form-card"
          type="text"
          placeholder={`Si puedes aportar algo más, coméntalo!...`}
        />
        <input type="text" placeholder="signicado" />
      </form>
    </div>
  );
};

export default FormCard;
